export default function GetDetailInfo({information,detail,id}) {
    const apiUrl = `http://localhost:3000/${information}/${detail}/${id}`;

    return fetch(apiUrl)
      .then(res => res.json())
      .then((data)=>{
        return data.results
      })
      .catch((error) => {
        console.error(error);
      })
}
